import React from "react";
import { sphere } from "./primitives";
import Shader from "./Shader.js";
import { Dropdown } from "rsuite";

import { fs } from "./fragmentShader.js";

export default function PrimitiveNode({ data }) {
    const handleChange = (val, ev) =>{
        console.log(val);
    }
  return (
    <div className="custom-node">
      <div className="custom-node-header">Primitive</div>
      <Dropdown title="Primitive" onSelect={handleChange}>
        <Dropdown.Item>Sphere</Dropdown.Item>
        <Dropdown.Item>New File with Current Profile</Dropdown.Item>
        <Dropdown.Item>Download As...</Dropdown.Item>
        <Dropdown.Item>Export PDF</Dropdown.Item>
        <Dropdown.Item>Export HTML</Dropdown.Item>
        <Dropdown.Item>Settings</Dropdown.Item>
        <Dropdown.Item>About</Dropdown.Item>
      </Dropdown>
      <Shader
        shader={fs(sphere(1))}
        uniforms={{ color: { type: "3fv", value: [1.0, 1.0, 0.0] } }}
        style={{ margin: "10px" }}
      />
    </div>
  );
}
